/**
 * Returns a value by name.
 *
 * @param name
 *            the name of the column to be retrieved.
 * @return the column value, or {@code null} if the column name is not found
 * @throws IllegalStateException
 *             if no header mapping was provided
 * @throws IllegalArgumentException
 *             if the record is inconsistent
 * @see #isConsistent()
 */
public String get(final String name) {
    if (mapping == null) {
        throw new IllegalStateException(
                "No header mapping was specified, the record values can't be accessed by name");
    }
    final Integer index = mapping.get(name);
    if (index != null && index.intValue() < values.length) {
        return values[index.intValue()];
    } else {
        throw new IllegalArgumentException("Column name not found or inconsistent record");
    }
}

/**
 * Returns a value by name.
 *
 * @param name
 *            the name of the column to be retrieved.
 * @return the column value, or {@code null} if the column name is not found
 * @throws IllegalStateException
 *             if no header mapping was provided
 * @throws IllegalArgumentException
 *             if the record is inconsistent
 * @see #isConsistent()
 */
public String get(final String name) {
    if (mapping == null) {
        throw new IllegalStateException(
                "No header mapping was specified, the record values can't be accessed by name");
    }
    if (mapping.containsKey(name)) {
        final Integer index = mapping.get(name);
        if (index < values.length) {
            return values[index];
        } else {
            throw new IllegalArgumentException("The record is inconsistent");
        }
    } else {
        return null;
    }
}

/**
 * Returns a value by name.
 *
 * @param name
 *            the name of the column to be retrieved.
 * @return the column value, or {@code null} if the column name is not found
 * @throws IllegalStateException
 *             if no header mapping was provided
 * @throws IllegalArgumentException
 *             if the record is inconsistent
 * @see #isConsistent()
 */
public String get(final String name) {
    if (mapping == null) {
        throw new IllegalStateException(
                "No header mapping was specified, the record values can't be accessed by name");
    }
    final Integer index = mapping.get(name);
    if (index == null) {
        return null;
    } else if (index.intValue() >= values.length) {
        throw new IllegalArgumentException("Invalid header mapping: index out of bounds");
    } else {
        return values[index.intValue()];
    }
}

